export function openSansFonts(jsPDFAPI) {
  const fontNormal =
    // eslint-disable-next-line max-len
    '';

  const fontBold =
    // eslint-disable-next-line max-len
    '';

  const callAddFont = function () {
    this.addFileToVFS('OpenSans-Regular.ttf', fontNormal);
    this.addFont('OpenSans-Regular.ttf', 'OpenSans', 'normal');

    this.addFileToVFS('OpenSans-Bold.ttf', fontBold);
    this.addFont('OpenSans-Bold.ttf', 'OpenSans', 'bold');
  };
  jsPDFAPI.events.push(['addFonts', callAddFont]);
}
